import Card from "./card";

const CardList = () => {
  const MOCK_DATA = [
    { title: '한글', content: 'Korean' },
    { title: '영어', content: 'English' },
    { title: '호주', content: 'Australia' },
  ];

  <section>
    {
    MOCK_DATA.map((card)=> (
      <Card title={card.title} content={card.content}/>
    ))
    }
  </section>

}

export default CardList;
